import React from "react";
import ReactMultiSelectCheckboxes from "./CheckMeses";
import DateForm from "./DateForm";

import Radio from '@material-ui/core/Radio';
import RadioGroup from '@material-ui/core/RadioGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import FormControl from '@material-ui/core/FormControl';
import FormLabel from '@material-ui/core/FormLabel';




export default function RadioB() {
  const [currentRadioValue, setCurrentValue] = React.useState("on");

  const handleRadioChange = (value) => {
    setCurrentValue(value);
  };
  return (
    <div>
      <FormControl component="fieldset">
      <FormLabel component="legend"></FormLabel>
      <RadioGroup row aria-label="period" name="row-radio-buttons-group">
        <FormControlLabel value="exercicio" control={<Radio />} label="Exercício" />
        <FormControlLabel value="periodo" control={<Radio />} label="Período" />

      </RadioGroup>
    </FormControl>

    </div>
  );
}
